        if(!state.enhanceJs[record.code]){
          let arr = []
          arr.push({...record})
          state.enhanceJs[record.code] = arr
        }
        state.enhanceJs[record.code].push({...record})
      }
      let arr = state.enhanceJs[record.code]
      while(arr.length>16){
        arr.shift()
      }
      Vue.ls.set('enhance_'+record['code'], arr)
    }
  },
